int
init_zhe(int lgno) {

    register int  i;
    unsigned long cid;

    if (zhe_MAX_TRIGs) {
        languages[lgno].dict = make_dict(2 * zhe_MAX_TRIGs, 0);
        languages[lgno].hash = (double *)malloc(sizeof(double) * zhe_MAX_TRIGs);
        if (!languages[lgno].hash) return(1);
        for (i = 0; i < zhe_MAX_TRIGs; i++) {
           cid = string2id((char *)zhe_hash[i].trig, languages[lgno].dict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].hash[cid] = zhe_hash[i].prob;
        }
        languages[lgno].wdict = make_dict(2 * 69, 0);
        languages[lgno].whash = (double *)malloc(sizeof(double) * 69);
        for ( i = 0; i < 68; i++) {
           cid = string2id((char *)zhe_wordhash[i].word, languages[lgno].wdict, insert_copy);
           if (cid == ~0) return(1);
           languages[lgno].whash[cid] = zhe_wordhash[i].prob;
        }
    } else languages[lgno].used = 0;

    return(0);
}
